import gapProperties from 'postcss-gap-properties';
import Button from './Button'
import axios from 'axios'
import Input from './Input';
import Navigation from './Navigation';
import React, { useState } from 'react';

function Home(props) {
    const [taskValue, setTaskValue] = useState("");
    const [etcValue, setEtcValue] = useState("");
    const [startDateValue, setStartDateValue ] = useState("");
    const [startTimeValue, setStartTimeValue] = useState("");
    const [deadDateValue, setDeadDateValue] = useState("");
    const [deadTimeValue, setDeadTimeValue] = useState("");
    props.changePage("home")
    function handleTaskValueChange (e) {
        setTaskValue(e.target.value)
      }

      function handleEtcValueChange (e) {
        setEtcValue(e.target.value)
      }

      function handleStartDateValueChange(e){
        setStartDateValue(e.target.value)
      }

      function handleStartTimeValueChange(e){
        setStartTimeValue(e.target.value)
      }

      function handleDeadDateValueChange(e){
        setDeadDateValue(e.target.value)
      }

      function handleDeadTimeValueChange(e){
        setDeadTimeValue(e.target.value)
      }

      function sendData(){
            if(startDateValue!=""){
                const formatedDate = startDateValue.split('/').reverse().join('-')
                const formatedTime = startTimeValue
                const startDateTime = startDateValue+"T"+startTimeValue
                const etcFloat = parseFloat(etcValue)
                const ltdValue= etcFloat*60
                axios.post("localhost:3000/fixed_task/create",{
                  task:{
                    name:taskValue,
                    status:"status",
                    etc:etcFloat
                  },
                  time:startDateTime,
                  ltd:ltdValue
                }).then(response=>{
                  console.log(response)
                }).catch(error => console.log(error.response.data))
            }
            else{

            }
      }

  return (
    <div className="grid place-items-center">

      <div className="grid grid-cols-2 gap-1 max-w-lg">
      <p className="min-h-10"></p>
      <p className="text-center text-lg col-span-2">Task</p>
      <div className="col-span-2">
      <Input placeholder="Task Name" handleChange={handleTaskValueChange}/>
      </div>
      <div className="col-span-2">
      <Input placeholder="Expected Time To Complete" handleChange={handleEtcValueChange}/>
      </div>
      <Input placeholder="Start Date" handleChange={handleStartDateValueChange}/>
      <Input placeholder="Start Time" handleChange={handleStartTimeValueChange}/>
      <Input placeholder="Deadline Date" handleChange={handleDeadDateValueChange}/>
      <Input placeholder="Deadline Time" handleChange={handleDeadTimeValueChange}/>

      <div className="col-span-2">
      <Button sendData={sendData}>
        Submit
      </Button>
      </div>
    </div>

    </div>
  );
}



export default Home;
